import React, { useState } from 'react';

const SignupPage = () => {
  const [firstName, setFirstName] = useState('');
  const [middleName, setMiddleName] = useState(null);
  const [lastName, setLastName] = useState('');
  const [mobilePersonal, setMobilePersonal] = useState('');
  const [state, setState] = useState('');
  const [district, setDistrict] = useState('');
  const [pincode, setPincode] = useState('');
  const [addressLine, setAddressLine] = useState(null);
  const [mobileEmergency, setMobileEmergency] = useState('');
  const [dob, setDob] = useState('');
  const [sex, setSex] = useState('');
  const [bloodGroup, setBloodGroup] = useState('');
  const [staffOrStudent, setStaffOrStudent] = useState(false);

  const handleSubmit = (e) => {
    e.preventDefault();

    // Prepare the data object
    const userData = {
      first_name: firstName,
      middle_name: middleName,
      last_name: lastName,
      mobile_personal: mobilePersonal,
      state,
      district,
      pincode,
      address_line: addressLine,
      mobile_emergency: mobileEmergency,
      dob,
      sex,
      blood_group: bloodGroup,
      staff_or_student: staffOrStudent,
    };

    // You can send the userData to the backend for further processing
    console.log(userData);

    // Reset the form fields
    setFirstName('');
    setMiddleName(null);
    setLastName('');
    setMobilePersonal('');
    setState('');
    setDistrict('');
    setPincode('');
    setAddressLine(null);
    setMobileEmergency('');
    setDob('');
    setSex('');
    setBloodGroup('');
    setStaffOrStudent(false);
  };

  return (
    <div className="w-50 mx-auto" style={{overflow:'hidden', position:'absolute'}}>
      <h2>Signup</h2>
      <form onSubmit={handleSubmit}>
        <div className='form-floating'>
          <input
            className='form-control'
            type="text" 
            id="first_name" 
            name="first_name" 
            value={firstName}
            onChange={(e) => setFirstName(e.target.value)}
            placeholder='First Name'
            required
          />
          <label htmlFor="first_name">First Name</label>
        </div>

        <div className='form-floating'>
          <input
            className='form-control'
            type="text" 
            id="middle_name" 
            name="middle_name" 
            value={middleName}
            onChange={(e) => setMiddleName(e.target.value)}
            placeholder='Middle Name'
          />
          <label htmlFor="middle_name">Middle Name</label>
        </div>

        <div className='form-floating'>
          <input
            className='form-control'
            type="text" 
            id="last_name" 
            name="last_name" 
            value={lastName}
            onChange={(e) => setLastName(e.target.value)}
            placeholder='Last Name'
            required
          />
          <label htmlFor="last_name">Last Name</label>
        </div>

        <div className='form-floating'>
          <input
            className='form-control'
            type="tel" 
            id="mobile_personal" 
            name="mobile_personal" 
            value={mobilePersonal}
            onChange={(e) => setMobilePersonal(e.target.value)}
            placeholder='Personal Mobile'
            required
          />
          <label htmlFor="mobile_personal">Personal Mobile</label>
        </div>

        <div className='form-floating'>
          <input
            className='form-control'
            type="text" 
            id="state" 
            name="state" 
            value={state}
            onChange={(e) => setState(e.target.value)}
            placeholder='State'
            required
          />
          <label htmlFor="state">State</label>
        </div>

        <div className='form-floating'>
          <input
            className='form-control'
            type="text" 
            id="district" 
            name="district" 
            value={district}
            onChange={(e) => setDistrict(e.target.value)}
            placeholder='District'
            required
          />
          <label htmlFor="district">District</label>
        </div>

        <div className='form-floating'>
          <input
            className='form-control'
            type="text" 
            id="pincode" 
            name="pincode" 
            value={pincode}
            onChange={(e) => setPincode(e.target.value)}
            placeholder='Pincode'
            required
          />
          <label htmlFor="pincode">Pincode</label>
        </div>

        <div className='form-floating'>
          <input
            className='form-control'
            type="text" 
            id="address_line" 
            name="address_line" 
            value={addressLine}
            onChange={(e) => setAddressLine(e.target.value)}
            placeholder='Address Line'
          />
          <label htmlFor="address_line">Address Line</label>
        </div>

        <div className='form-floating'>
          <input
            className='form-control'
            type="tel" 
            id="mobile_emergency" 
            name="mobile_emergency" 
            value={mobileEmergency}
            onChange={(e) => setMobileEmergency(e.target.value)}
            placeholder='Emergency Mobile'
            required
          />
          <label htmlFor="mobile_emergency">Emergency Mobile</label>
        </div>

        <div className='form-floating'>
          <input
            className='form-control'
            type="date" 
            id="dob" 
            name="dob" 
            value={dob}
            onChange={(e) => setDob(e.target.value)}
            placeholder='Date of Birth'
            required
          />
          <label htmlFor="dob">Date of Birth</label>
        </div>

        <div className='form-floating'>
          <select
            className='form-control'
            id="sex"
            name="sex"
            value={sex}
            onChange={(e) => setSex(e.target.value)}
            required
          >
            <option value="">Select</option>
            <option value="Male">Male</option>
            <option value="Female">Female</option>
            <option value="Other">Other</option>
          </select>
          <label htmlFor="sex">Sex</label>
        </div>

        <div className='form-floating'>
          <input
            className='form-control'
            type="text" 
            id="blood_group" 
            name="blood_group" 
            value={bloodGroup}
            onChange={(e) => setBloodGroup(e.target.value)}
            placeholder='Blood Group'
          />
          <label htmlFor="blood_group">Blood Group</label>
        </div>

        <div className='form-floating'>
          <select
            className='form-control'
           id="staff_or_student" 
            name="staff_or_student" 
            value={staffOrStudent}
            onChange={(e) => setStaffOrStudent(e.target.value === 'true')}
            required
          >
            <option value="">Select</option>
            <option value="true">Staff</option>
            <option value="false">Student</option>
          </select>
          <label htmlFor="staff_or_student">Staff or Student</label>
        </div>

        <button className='btm btm-success' type="submit">Submit</button>
      </form>
    </div>
  );
}

export default SignupPage;
